import React from "react";
import userImage from '../../assents/userImage.png'
export default function NewCard() {
  return (
    <div className="">
    <div>
      <img src={userImage} className="Img" />
      <h1>Jane Cooper</h1>
      <h3>Art Director</h3>
    </div>
    </div>
  );
}
